import React, { Component } from "react";
class RenderCycle extends Component{
    constructor(){
        super();
        this.state={
            name:"Vini"
        }
    }
    render(){
        console.log("render")
        return <>
        <h1>Hello {this.state.name}</h1>
        <button onClick={()=> this.setState({name:"Chawla"})}>Update</button>
        </>
    }
    
}

export default RenderCycle;
